def find_min_distance(s, target1, target2):
    target1_index = s.find(target1)
    target2_index = s.find(target2)

    if target1_index == -1 or target2_index == -1:
        return -1

    min_distance = abs(target1_index - target2_index)

    # Sliding window
    for i in range(min(target1_index, target2_index) + 1, max(target1_index, target2_index)):
        if s[i] == target1[0] or s[i] == target2[0]:
            min_distance = min(min_distance, i - target1_index)

    return min_distance

